package task.leet75;

public class IsSubsequence {
    public boolean isSubsequence(String s, String t) {
        final char[] str = t.toCharArray();
        final char[] substrCandidate = s.toCharArray();

        int symbolPosition = 0;
        boolean found = false;

        for (char c : substrCandidate) {
            for (int i1 = symbolPosition; i1 < str.length; i1++) {
                if (str[i1] == c) {
                    symbolPosition = i1;
                    found = true;
                    break;
                }
            }

            if (!found) {
                return false;
            }

            symbolPosition++;
            found = false;
        }

        return true;
    }

    public static void main(String[] args) {
        System.out.println(new IsSubsequence().isSubsequence(
            "leeeeetcode",
            ""
        ));
    }
}
